import React from 'react';
import {MenuContainer, MenuBrick, Header, MainPane, HeaderPane} from './Components.js'

import './css/main.css';

var menuList = [{name: "Aktualności", id: "home"}, {name: "O Mnie", id: "about"},
                {name: "Cennik", id: "prices"}, {name: "Opinie", id:"opinions"}];

function App() {
  return (
    <div className="app">
      <Header>Jarosław Kalinowski</Header>
      <MenuContainer menuList={menuList}/>
      <MainPane></MainPane>
    </div>
  );
}

export default App;
